    const arr1 = [1, 2, 3];
    const arr2 = [4, 5, 6];
    const arr3 = [7, 8, 9];
    const iteratee = String;

    expect(intersectionBy(iteratee, arr1, arr2, arr3)).toEqual([]);
  });

  test('single array', () => {
    const arr1 = [1, 2.5, 3, 7.8];
    const iteratee = Math.floor;

    expect(intersectionBy(iteratee, arr1)).toEqual([1, 2.5, 3, 7.8]);
  });

